import LinkItemList from '../../features/linkItemList/LinkItemList'

import '../itemWindow/itemWindowStyle.css'

const ItemWindow = () => {
  return (
    <div className='itemWindow'>
      <LinkItemList></LinkItemList>
    </div>
  )
}

export default ItemWindow
